import React, { Component } from "react";
import ReactDOM from 'react-dom';
import PropTypes from "prop-types";


const styleCss = {
    color: "#DC143C",
    margin: "300px 400px",
    justifyItems: "center",
    fontFamily: "sans-serif"
}

const Side = {

}

const Side1 = {
    fontFamily: 'sans-serif',
    textDecoration: 'none',
    fontSize: '15px',
    fontWeight: 'bold',
}

class Profile extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() {
        return (
            <div>
                <div style={Side}>
                    <h1>{this.props.name}</h1>
                </div>
                <div>
                <ul style={Side1}>
                    <li>{this.props.Home}</li>
                    <li>{this.props.Products}</li>
                    <li>{this.props.About}</li>
                    <li>{this.props.Contacts}</li>
                </ul>
                </div>
                <div style={styleCss}>
                <h1>{this.props.children}</h1>
                <h2>{this.props.fullName}</h2>
                <h2>{this.props.profession}</h2>
                <h2>{this.props.bio}</h2>
                </div>
            </div>
        );
    }
}


export default Profile;
